import "./App.css";

function App() {
  function getTrivia() {
    fetch("https://the-trivia-api.com/v2/questions")
      .then((response) => response.json())
      .then((data) => {
        data.foreach((data) => {
          if (data.category == "music") {
            console.log(data.category);
          }
        });
      })
      .catch((err) => console.error(err));
  }

  return (
    <div className="App">
      <button onClick={getTrivia}>CLICK FOR TRIVIA</button>
    </div>
  );
}

export default App;
